INSERT INTO `companies` (`id`, `name`, `description`, `image`)
VALUES
	(1,'BoltBus','Bolt understands that customers expect simplicity when it comes to traveling on a bus. And when it comes to a frequent rider program, we’re keeping it simple as well. \n\nIntroducing the Bolt Rewards program. No miles, no restrictions. Simply take eight trips on BoltBus and you’re eligible for a free one-way ticket trip. \n\nThat’s it. No strings attached. Valid at any time, regardless of time of day, day of week, or even holiday travel. You’ve earned it, so why not use it whenever you want? \n','boltbus.jpg'),
	(2,'Greyhound','Founded in 1914, Greyhound Lines, Inc. is the largest provider of intercity bus transportation, serving more than 3,800 destinations with 13,000 daily departures across North America. It has become an American icon, providing safe, enjoyable and affordable travel to nearly 25 million passengers each year. The Greyhound running dog is one of the most-recognized brands in the world.\n\nWhile Greyhound is well known for its regularly scheduled passenger service, the company also provides a number of other services for its customers. Greyhound PackageXpress service offers value-priced same-day and early-next-day package delivery to thousands of destinations. And the company\'s Greyhound Travel Services unit offers charter packages for businesses, conventions, schools and other groups at competitive rates.\n\nGreyhound has three operating subsidiaries in the United States, which are a part of the nationwide Greyhound network. They include: Valley Transit Company, serving the Texas-Mexico border, Crucero USA, serving southern California and Arizona into Mexico, and Americanos USA, serving points in Mexico from Texas and New Mexico.\n\nIn addition, Greyhound has interline partnerships with a number of independent bus lines across the United States. These bus companies provide complementary service to Greyhound Lines\' existing schedules and link to many of the smaller towns in Greyhound Lines\' national route system.\n\nAmtrak passengers use Greyhound to make connections to cities not served by rail on Amtrak Thruway service, by purchasing a ticket for the bus connection from Amtrak in conjunction with the purchase of their rail ticket. If passengers desire, they may also buy a bus ticket directly from Greyhound.\n\nFor travel within Canada, Greyhound Canada carries millions of passengers across the country\'s provinces and territories each year. The company also provides Greyhound Courier Express package delivery service to its various Canadian locations.\n\nFor those within Mexico who wish to travel by Greyhound in the United States, Greyhound subsidiary Greyhound de Mexico can sell Greyhound tickets at one of more than 100 agencies located throughout Mexico. The agencies also sell tickets for several Mexican bus companies, like Estrella Blanca, which connect to Greyhound service at the United States-Mexico border cities.','greyhound.png'),
	(3,'Megabus','Megabus.com is the first, low-cost, express bus service to offer city center-to-city center travel for as low as $1 via the Internet. Since launching in April 2006, megabus.com has served more than 24 million customers throughout more than 100 cities across North America.  Our luxury single and double deckers offer free wi-fi, at-seat plug ins, panoramic windows and a green alternative way to travel. Meticulously maintained with professional drivers at the wheel, when you travel with megabus.com, you will be riding in comfort and confidence. We provide affordable and reliable bus services, offering the highest level of comfort and safety.  You can be assured of a great experience and overall satisfaction when you choose megabus.com. Our professional staff, and our fleet of clean, comfortable, well maintained wheelchair accessible, state-of-the-art double decker buses enable us to provide you with the dependable, quality service you expect.  We look forward to serving you!','megabus.png'),
	(4,'Peterpan','Today, Peter Pan is one of the largest privately owned intercity bus companies in the United States with the most modern fleet of buses numbering 250 vehicles. Our new state-of-the-art, custom designed motorcoaches have changed bus travel forever. Peter Pan’s 750 employees include the best drivers in the industry. Our highly-trained drivers have been recognized nationally for their achievements in safety … see our section on “Safety & Drivers” to meet some of our award-winning One-, Two- and Three-Million Mile drivers! Peter Pan coaches travel over 25 million miles a year: The equivalent of nearly 100 trips to the moon annually… or one of our buses going around the world three times every day!','peterpan.jpg'),
	(5,'LuckyStar',' Established in 2003, Lucky River Transportation Inc offers competitive fare to customers traveling between Boston and New York City. Since then, Lucky Star evolved from a family style operation business into a corporation which maintains its fleet of more than 20 luxury motor coaches from the state of the art maintenance facility. \"We are serious about our service because we strive to provide a professional, dependable and safe environment to our passengers.\"','luckystar.gif'),
	(6,'GoBus','GO Buses is dedicated to providing safe, reliable and professional bus charter services in and around the Metropolitan Area. We offer the finest service for those who enjoy traveling in style and comfort. Whether you need group transportation to and from airports, hotels, amusement parks or casinos, our experienced and courteous drivers strive for top-quality service.\nWith our wide range of services, GO Buses provides travel services for all group sizes. Our services include, travel to and from destinations, arranging New York City sightseeing in any language, dining, theater, cultural and arts venues and admission to famous New York City attractions. GO Buses is also a contracted vendor of the New York City Board of Education, which allows us to provide charter services to schools for round-trip transportation of students.','no_logo.png'),
	(7,'Amtrack','The National Railroad Passenger Corporation, Amtrak, is a corporation striving to deliver a high quality, safe, on-time rail passenger service that exceeds customer expectations. Learn all about Amtrak here from every angle.','no_logo.png');
